import MyroomDust from "./MyroomDust";
import InsideDustState from "./InsideDustState";


export default function InsideDust(props) {
  const main = props.Dust
  return (
    <>
      <InsideDustState dusts={main} />
      <MyroomDust dusts={main}></MyroomDust>
    </>
  );
}
